import React from "react";
import Header from "../Header";
import './Apartament.css'
import CheckInSection from '../CheckInSection'
import HotelRoom from "./HotelRoom";
import room1 from '../images/room-1.jpg'
import room2 from '../images/room2.jpg'
import room3 from '../images/room7.jpg'
import room4 from '../images/room14.jpg'

export default function Apartament(){
    return(
        <div className="book-background">
        <Header background2={`background2`} background={`back2`} backApart={`backapart`}/>
        <CheckInSection
         HotelRoom={<HotelRoom suite='Junior Suite' size='260'bed='2' price='350' src={room1} icon='<i class="fa-solid fa-toilet-paper"></i>
         <i class="fa-solid fa-utensils"></i>'/>}
         HotelRoom1={<HotelRoom suite='Standart Room' size='230'bed='1' price='250' src={room2}/>}
         HotelRoom2={<HotelRoom suite='Superior Room' size='270'bed='1' price='550' src={room3}/>}
         HotelRoom3={<HotelRoom suite='Standart Room' size='280'bed='2' price='250' src={room4}/>}/>
        </div>
    )
}
